This one yes saved by yer' Captn' from an evil harlot. Me ex-skank decided one day that I loved me porno collection more than 'er. Silly wench started kicking, and then spraying hairspray all over the backsides of me discs! In a frenzy, yours truly went to work, feverishly cleaning the spoiled treasures with baby toothpaste and a bit O' Grog after I had thrown the Evil One overboard.
This one ere', a Jim Holliday, Paradise Hole, somehow got lost in the chaos....and I tried in vain to resurrect it completely, to no avail, but did save this little 2 minute scene for me mates.
